import React, { useState } from "react";
import Home from "./components/Home";
import { AccountBox } from "./accountBox";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" component={Home} />
        <Route path="/register" component={AccountBox} />
      </Switch>
    </Router>
  );
}

export default App;
